export declare const RectTst = "\nload Rect.asm;\nset %0 16;\n\nrepeat {\n   tick, tock;\n}\n";
export declare const RectAsm = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/6/rect/Rect.asm\n\n// Draws a rectangle at the top-left corner of the screen.\n// The rectangle is 16 pixels wide and R0 pixels high.\n// Usage: Before executing, put a value in R0.\n\n   // If (R0 <= 0) goto END else n = R0\n   @R0\n   D=M\n   @END\n   D;JLE \n   @n\n   M=D\n   // addr = base address of first screen row\n   @SCREEN\n   D=A\n   @addr\n   M=D\n(LOOP)\n   // RAM[addr] = -1\n   @addr\n   A=M\n   M=-1\n   // addr = base address of next screen row\n   @addr\n   D=M\n   @32\n   D=D+A\n   @addr\n   M=D\n   // decrements n and loops\n   @n\n   MD=M-1\n   @LOOP\n   D;JGT\n(END)\n   @END\n   0;JMP";
export declare const RectLAsm = "// This file is part of www.nand2tetris.org\n// and the book \"The Elements of Computing Systems\"\n// by Nisan and Schocken, MIT Press.\n// File name: projects/6/rect/RectL.asm\n\n// Symbol-less version of the Rect.asm program.\n// Designed for testing the basic version of the assembler.\n\n@0\nD=M\n@23\nD;JLE \n@16\nM=D\n@16384\nD=A\n@17\nM=D\n@17\nA=M\nM=-1\n@17\nD=M\n@32\nD=D+A\n@17\nM=D\n@16\nMD=M-1\n@10\nD;JGT\n@23\n0;JMP";
